import React from 'react';
import MapComponent from './components/MapComponent';
import AddLocationForm from './components/AddLocationForm';

const App = () => {
  return (
    <>
      <h2 style={{ textAlign: 'center' }}>Find Your Charging Station</h2>
      <AddLocationForm />
      <input id="start" placeholder="Enter Start Location" style={{ margin: '10px' }} />
<input id="end" placeholder="Enter End Location" style={{ margin: '10px' }} />
      <MapComponent />
    </>
  );
};

export default App;
